import { configureStore } from "@reduxjs/toolkit";
import authReducer from "./slices/authSlice.js";
import companyReducer from "./slices/companySlice.js";

export const store = configureStore({
  reducer: {
    auth: authReducer,
    company: companyReducer
  }
});
